import React from 'react';

function App() {
  let hello = ''
  const handleFetch = () => {
    fetch('localhost:3000').then(data => hello = data)
  }

  return (
    <div className="App">
      <button onClick={handleFetch}>
        Click me!
      </button>
    {hello}
  </div>
  );
}
